import React from "react";

export const DetailTablePreliquidation = () => {
  const titulos = ["ID", "Fecha", "Estado", "Monto"];
  const contenido = [
    {
      id: "AAB114",
      fecha: "07/12/2021",
      estado: "Entregada",
      monto: "$ 100,65",
    },
    {
      id: "AAB114",
      fecha: "07/12/2021",
      estado: "Entregada",
      monto: "$ 100,65",
    },
    {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
      {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
      {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
      {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
      {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
      {
        id: "AAB114",
        fecha: "07/12/2021",
        estado: "Entregada",
        monto: "$ 100,65",
      },
  ];
  return (
    <table>
      <thead>
        <tr>
          {titulos.map((el) => (
            <th key={el}>{el}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {contenido.map((el) => (
          <tr>
            <td>{el.id}</td>
            <td>{el.fecha}</td>
            <td>{el.estado}</td>
            <td> {el.monto}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};
